			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Wechsel in das Compiler-Verzeichnis und führe das Kompilierungsskript aus\ncd \"$PROJECT_DIR/compiler\" || exit 1\nbash compile_openmohaa.sh\n\n# Überprüfen, ob die Kompilierung erfolgreich war\nif [ $? -eq 0 ]; then\n    # Git-Commit-Hash und Datum der neuesten Änderung abrufen\n    GITHUB_URL=\"https://github.com/openmoh/openmohaa/commits/main/\"\n    RESPONSE=$(curl -s \"$GITHUB_URL\")\n\n    # Extrahieren des neuesten Commit-Hashes\n    new_commit=$(echo \"$RESPONSE\" | grep -Eo 'commit/[a-z0-9]{7}' | cut -d'/' -f2 | head -1)\n\n    # Extrahieren des Datums der neuesten Änderung und Umformatierung\n    new_date=$(echo \"$RESPONSE\" | grep -Eo '[0-9]{4}-[0-9]{2}-[0-9]{2}' | head -1 | \\\n        awk -F'-' '{printf \"%s.%s.%s\", $3, $2, substr($1, 3)}')\n\n    # Aktualisieren der Storyboard-Datei mit dem neuen Commit-Hash und Datum\n    sed -i '' \\\n        \"s/Commit [a-z0-9]\\{7\\} ([0-9]\\{2\\}\\.[0-9]\\{2\\}\\.[0-9]\\{2\\})/Commit $new_commit ($new_date)/\" \\\n        \"$PROJECT_DIR/OpenMOHAA Launcher/Base.lproj/Main.storyboard\"\nfi\n\n# Setze Ausführungsrechte für die relevanten Binärdateien\nchmod +x \"$PROJECT_DIR/OpenMOHAA Launcher/bin/omohaaded\" \\\n          \"$PROJECT_DIR/OpenMOHAA Launcher/bin/openmohaa\"\n";
		};
