			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "#!/bin/bash\n\n# Ermittelt den aktuellen Benutzer\nSYS_USER=$(id -un)\n\n# Wechselt in das Binärverzeichnis der App\ncd \"${TARGET_BUILD_DIR}/${PRODUCT_NAME}.app/Contents/Resources/bin\" || exit 1\n\n# Umbenennen der bestehenden ARM64-Bibliotheken\nmv cgame.dylib cgame.arm64.dylib\nmv game.dylib game.arm64.dylib\n\n# Symbolische Links für x86_64-Bibliotheken erstellen\nln -s cgame.arm64.dylib cgame.x86_64.dylib\nln -s game.arm64.dylib game.x86_64.dylib\n\n# Prüfen, ob das Upload-Verzeichnis existiert, und Dateien vorbereiten\nUPLOAD_DIR=\"/Volumes/Homeshare/Xcode/openmohaa/upload\"\nif [ -d \"$UPLOAD_DIR\" ]; then\n    # HTML-Datei kopieren\n    cp \"/Users/$SYS_USER/Documents/Xcode/openmohaa_launcher/OpenMOHAA Launcher/openmohaa.html\" \"$UPLOAD_DIR/\"\n    \n    # Codesignieren der App\n    codesign --force --deep --sign \"Apple Development: s.lamprecht@sl-soft.de (85JZW6284R)\" \\\n        \"${TARGET_BUILD_DIR}/${PRODUCT_NAME}.app\"\n    \n    # App als ZIP-Archiv erstellen\n    ditto -c -k --sequesterRsrc --keepParent \\\n        \"${TARGET_BUILD_DIR}/${PRODUCT_NAME}.app\" \"$UPLOAD_DIR/openmohaa.zip\"\nfi\n\n# Sicherstellen, dass keine alte Version der App auf dem Desktop existiert\nDESKTOP_APP=\"/Users/$SYS_USER/Desktop/${PRODUCT_NAME}.app\"\nif [ -d \"$DESKTOP_APP\" ]; then\n    rm -rf \"$DESKTOP_APP\"\nfi\n\n# App auf den Desktop kopieren\ncp -a \"${TARGET_BUILD_DIR}/${PRODUCT_NAME}.app\" \"/Users/$SYS_USER/Desktop/\"\n\n# App auf dem Desktop erneut codesignieren\ncodesign --force --deep --sign \"Apple Development: s.lamprecht@sl-soft.de (85JZW6284R)\" \"$DESKTOP_APP\"\n";
		};
		2AD1FD882CF8A2E800EB0DBE /* Dylibbundler */ = {
			isa = PBXShellScriptBuildPhase;
			alwaysOutOfDate = 1;
			buildActionMask = 2147483647;
