			shellPath = /bin/sh;
			shellScript = "#!/bin/bash\n\n# Erforderliche Abhängigkeiten:\n# ARM: /opt/homebrew/bin/brew install innoextract dylibbundler\n# x86: arch -x86_64 /usr/local/bin/./brew install innoextract dylibbundler\n\nexport PATH=\"/opt/homebrew/bin:$PATH\"\n\n# Variablen definieren\nBIN=\"innoextract\"\nDEST_PATH=\"$PROJECT_DIR/OpenMOHAA Launcher/bin/innoextract\"\nARM_PATH=\"/opt/homebrew/bin\"\nX86_PATH=\"/usr/local/bin\"\nARM_BUILD=\"arm\"\nX86_BUILD=\"x86\"\n\n# Zielpfad vorbereiten\ncd \"$DEST_PATH\" || exit 1\nmkdir -p \"$X86_BUILD\" \"$ARM_BUILD\"\n\n# Binärdateien für ARM und x86 kopieren\ncp \"$ARM_PATH/$BIN\" \"${BIN}_arm\"\ncp \"$X86_PATH/$BIN\" \"${BIN}_x86\"\n\n# Abhängigkeiten bündeln\nfor ARCH in arm x86; do\n    dylibbundler -of -cd -b -x \"${BIN}_$ARCH\" -d \"$ARCH\" -p \"@executable_path/\"\ndone\n\n# ARM- und x86-Bibliotheken kombinieren\ncd \"$ARM_BUILD\" || exit 1\nfor LIB in *.dylib; do\n    lipo \"$LIB\" \"../$X86_BUILD/$LIB\" -output \"../$LIB\" -create\ndone\n\ncd ..\n\n# ARM- und x86-Binärdateien kombinieren\nlipo \"${BIN}_arm\" \"${BIN}_x86\" -output \"$BIN\" -create\n\n# Temporäre Dateien und Verzeichnisse entfernen\nrm -r \"$X86_BUILD\" \"$ARM_BUILD\" \"${BIN}_\"*\n\n";
